import React, { Component } from 'react';

class UserCard extends Component {

  render() {
    const {name} = this.props;

    return (
      <div className="user-card">
        <div className="user-card-header">
          <div className="user-card__name">
            {name}
          </div>
        </div>
      </div>
    )
  }
}

export default UserCard;
